import logo from './logo.svg';
import './App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'

import {Button, Container, Row, Col, Alert, Breadcrumb} from 'react-bootstrap'
import { Route, Switch, Redirect, NavLink } from 'react-router-dom';

function App() {
  return (

    <div style={{flex: 1, backgroundColor: 'blue'}}>

      <header style={{height: '100vh'}} className="App-header">
        <img src={logo} style={{flex: 1 }}className="App-logo" alt="logo" />

        <div style={{
          justifyContent: 'center'
        }}
        className='Test'
          >
          <p style={{textAlign: 'center', backgroundColor: 'blue' }}> 
            This is a test
          </p>

          <Row>
            <Col md>
              <Button style={{margin: 10, width: 200}}>
                Hello
              </Button>

              <Button style={{margin: 10, width: 200}}>
                Hello
              </Button>
            </Col>
          </Row>
        </div>


      </header>
      {/* <div style={{backgroundColor: 'green', height: '100vh'}}>

      </div> */}
    </div>
  );
}

export default App;
